import './Form.css'
const ErrorModel = (props) => {
  return (
    <div className='error'>
        <header><h2>{props.title}</h2></header>
        <p>{props.message}</p>
        <footer>
            <button type="button">OKAY</button>
        </footer>
    </div>
  )
}

export default ErrorModel
